import React from 'react';

function joinParty(_joinGame) {

    // Swap Scene
    _joinGame();
}

function JoinParty(props) {
    return (
        <div>

            <label>
                Party Code:
                <input type="text" name="partyCode" />
            </label>
            
            <br/>

            <label>
                Name:
                <input type="text" name="name" />
            </label>
            
            <br/>

            <button onClick={joinParty(props.joinGame)}>Join Party</button>

            <br/>

            <button onClick={props.backClick}>Back</button>
        </div>
    );
}

export default JoinParty;
